import React from "react";
import styled from "styled-components";
import searchIcon from "../images/search.png";

export default function AppBar() {
  return (
    <div>
      <AppBarBox>
      <AppBarTop>로그인</AppBarTop>
      <AppBarDiv>
        <Logo> ⏣ 오늘 뭐 볼까 ?</Logo>
        <SearchBoxDiv>
          <SearchDiv> 무엇을 검색하시겠습니까 ? 
          {/* <input type="text" value={search} onChange={onChange} /> */}
          </SearchDiv>
          <button>
            <SearchImg src={searchIcon} alt="search" />
          </button>
        </SearchBoxDiv>
        <MenuBoxDiv>
          <MenuDiv> 서비스 </MenuDiv>
          <MenuDiv> 카테고리 </MenuDiv>
          <MenuDiv> 즐겨찾기 </MenuDiv>
        </MenuBoxDiv>
      </AppBarDiv>
      </AppBarBox>
    </div>
  );
}
const AppBaBox = styled.div`

`;
const AppBarTop = styled.div`

`;
const AppBarDiv = styled.div`
  display: flex;
  background: linear-gradient(to bottom, #000000, #4f4f51);
  color: white;
  font-size: 20px;
  border-top: solid 3px white;
  border-bottom: solid 3px white;
  align-items: center;
  justify-content: space-between;
  height: 70px;
  padding: 0 20px;
  box-shadow: 0px 1px 5px rgba(0, 0, 0, 0.1);
  border: 1px solid #ccc;
`;
const Logo = styled.div`
  font-size: 30px;
  padding: 20px;
`;
const SearchBoxDiv = styled.div`
  display: flex;
  border-left: solid 2px white;
  border-right: solid 2px white;
`;

const SearchDiv = styled.div`
  padding: 16px 230px 12px 27px;
  /* padding-right: 79px; */
  font-size: 20px;
  color:grey;
`;
const SearchImg = styled.img`
  width: 50px;
  height: 50px;
`;
const MenuBoxDiv = styled.div`
  display: flex;
  justify-content: space-between;
  padding-right: 100px;
  font-size: 20px;
`;
const MenuDiv = styled.div`
  padding: 0px 0px  0px  40px;
`;
